import './App.css';
import Header from "./common/header/Header"
// This is a React Router v5 app
import { BrowserRouter as Router } from "react-router-dom";
import { Pages } from './pages/Pages';
// import { Switch } from "react-router";
function App() {
  return (

      <Router>
       <Header>
        {/* <Switch> */}
          <Route path='/' exact>
            <Pages></Pages>
          </Route>
        {/* </Switch> */}
       </Header>
      </Router>

  );
}

export default App;
